import { useState, useEffect } from "react";

const Boutique = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/productos/")
      .then(function (results) {
        return results.json();
      })
      .then(function (data) {
        //console.log(data);
        setData(data);
      });
  }, []);

  return "boutique";
};

export default Boutique;
